const { v4: uuidv4 } = require("uuid");

//src3
let items = [
  {
    id: uuidv4(),
    name: "ABC Lorem ipsum dolor, 'mot' consectetur high adipisicing elit.", //12ss
    level: 1,
  },
  {
    id: uuidv4(),
    name: "DEF Lorem ipsum dolor, 'hai' amet consectetur  adipisicing elit.",
    level: 2,
  },
  {
    id: uuidv4(),
    name: "GHJ Lorem ipsum dolor, 'khong' amet consectetur adipisicing elit.",
    level: 0,
  },
  {
    id: uuidv4(),
    name: "NKL Lorem ipsum dolor, 'mot' amet consectetur adipisicing elit.",
    level: 1,
  },
];

export default items;
